import React from 'react';
import EventRegistrationForm from './components/Form.js';
import Homepage from './components/Homepage.js';

const App = () => {
  return (
      <Router>
        <Routes>
          <Route path="/" element={<EventRegistrationForm />} />
          <Route path="/submitted" element={<Homepage />} />
        </Routes>
      </Router>
    );
};

export default App;
